import React, { Fragment, useState } from "react";

import { Box, FormControlLabel, Checkbox } from "@mui/material";

const InvoicePayment = () => {
  const [invoiceData, setInvoiceData] = useState({
    payment_method: "",
    contact: "",
    billable: false,
    date_range: "",
    create_date: "",
    due_date: "",
    template: "",
    invoice_no: "",
    discount: "",
    submit: false,
  });

  const {
    matter,
    contact,
    billable,
    date_range,
    create_date,
    due_date,
    template,
    invoice_no,
    discount,
    submit,
  } = invoiceData;
  const onChange = (e) =>
    setInvoiceData({ ...invoiceData, [e.target.name]: e.target.value });

  const onSubmit = (e) => {
    e.preventDefault();
  };
